import React from 'react';
import LargeButton from '../components/LargeButton';
import { useNavigate } from 'react-router-dom';

const Home = () => {

    const navigate = useNavigate();

    return (
        <div className='absolute top-1/4 lg:mt-5 flex lg:flex-row flex-col content-center lg:gap-x-10 gap-y-10 px-10 items-center'>
            <div className="w-3/4">
                <LargeButton
                    colour='blue'
                    label="Skills & Education"
                    desc="Coding languages, technologies, and educational accomplishments"
                    onClick={() => navigate('/skills')}
                    className=""
                />
            </div>
            <div className="w-3/4">
                <LargeButton
                    colour='yellow'
                    label="Projects & Experience"
                    desc="Exhibit of personal projects and work experiences"
                    onClick={() => navigate('/projects')}
                />
            </div>
        </div>
    );
};

export default Home;
